function ControlPanel({ sensors }) {
    console.log(sensors);

    return (  
        <div className="flex flex-row flex-wrap items-center">
            {
                sensors.map((face) => {
                    return <div key={face.face} className="flex flex-col items-center p-4 gap-y-4 border-solid border-[1px]">
                        {face.face}
                    </div>
                })
            }
        </div>
    );
}

export default ControlPanel;
